import './Footer.css'
import footer_logo from '../Assets/logo_big.png'

export const Footer = () => {
  return (
    <div className='footer'>
        <div className="footer-logo">
            <img src={footer_logo} alt="" />
            <p></p>
        </div>
    </div>
  )
}
